import React from 'react';
import { render } from '@testing-library/react';
import '@testing-library/jest-dom/extend-expect';
import { ImageEditor } from '../../src/annotations/ImageEditor';

const mockAnnotatedImage = {
    name: 'myTest',
    image: 'data:image/jpeg;base64,',
    annotations: [
      {
        label: 'test #1',
        points: [{ x: 5, y: 23 }, { x: 32, y: 39 }, { x: 49, y: 72 }]
      },
      {
        label: 'test #2',
        points: [{ x: 72, y: 91 }, { x: 100, y: 110 }, { x: 120, y: 130 }]
      }
    ]
  };

describe("ImageEditor Component", () => {
    describe("when component is loaded", () => {
      it('should render with the correct name and image', async () => {
        const mockAnnotatedImage = { id: 0, name: 'Test Image', image: 'test-image.jpg', annotations: [] };
        const { getByTestId, container } = render(
          <ImageEditor annotatedImage={mockAnnotatedImage} onClose={() => {}} onCreate={() => {}} onUpdate={() => {}} />
        );
    
        const nameInput = getByTestId('name-input') as HTMLInputElement;
        expect(nameInput.value).toEqual(mockAnnotatedImage.name);
      });

      it("should render the canvas element", () => {
        const mockAnnotatedImage = {
          name: "Test Image",
          image: "image-data-url",
          annotations: []
        };
        const { getByTestId } = render(
          <ImageEditor annotatedImage={mockAnnotatedImage} onClose={() => {}} onUpdate={() => {}} onCreate={() => {}} />
        );

        const canvas = getByTestId("canvas") as HTMLCanvasElement;
        expect(canvas).toBeInTheDocument();
      });
    });
});